import{_ as o,c as s,J as a,m as e,a as n,o as c,G as l}from"./chunks/framework.SV1ROkXV.js";const G=JSON.parse('{"title":"我二🐑 了","description":"新冠病毒二阳了","frontmatter":{"title":"我二🐑 了","description":"新冠病毒二阳了","keywords":"COVID-19,新冠病毒,新冠二阳","prev":false,"next":false,"aside":false},"headers":[],"relativePath":"talk/2023/second-covid.md","filePath":"talk/2023/second-covid.md","lastUpdated":1709440279000}'),d={name:"talk/2023/second-covid.md"},i=e("h1",{id:"我二🐑了",tabindex:"-1"},[n("我二🐑了 "),e("a",{class:"header-anchor",href:"#我二🐑了","aria-label":'Permalink to "我二🐑了"'},"​")],-1),r=e("p",null,"就在昨天（23/06/02）我二🐑了，这天周五早上起床，发现自己有点发烧没有精神，于是就测了下体温：37.4°C，此时我还没想到🐑，吃完早餐喝了点感冒灵就去上班了。",-1),_=e("p",null,"地铁里空调风狠狠地向我扑来，打了个喷嚏、真冷！到公司后就开始不断擦鼻涕、声音也感觉变了。然后我就不断的接开水喝，一杯又一杯。身体逐渐乏力，两眼开始眩晕，感觉无力再敲代码，最后决定下午请假，回去好好养病。",-1),p=e("p",null,"终于等到中午下班了，收拾好装备就打卡下班了。在地铁上的我感觉体温升高，也越来越蓝瘦…",-1),h=e("p",null,"到家后二话不说立马测了个体温，竟飙到惊人的38°C！告诉女友后，说让我喝点退烧药，就拿出家里备用的药💊喝了后躺床上了。",-1),m=e("p",null,"六月的广东骄阳似火，发烧的我也不敢开空调，床上的我如蒸笼乳猪无法静心养病，这种情况真是束手无策，就这样一直熬到傍晚。女友下班后帮我测了个抗原检测，没想到还真中奖了（女友上周五也阳了）",-1),f=e("p",null,"可能5、6月份也到了二🐑的阶段，但是没想到会发生在自己身上。平时我也不怎么戴口罩，然后也没什么问题。回想还是周三晚上洗完冷水澡后直吹空调导致周四就感觉到鼻子不太舒服了，由于没有任何措施周五就开始发烧了。我猜自己可能早就阳了只是这次空调成为诱因吧！总之，这次体温都保持在38°C以下属于低烧，其他喉咙什么的都没有症状，万幸在周日就已经不发烧了。",-1),u=e("p",null,"最后，希望在外的每一个人还是提高警惕注意防护，保护好自己！",-1);function k(v,x,C,N,V,$){const t=l("Gitalk");return c(),s("div",null,[i,r,_,p,h,m,f,u,a(t)])}const P=o(d,[["render",k]]);export{G as __pageData,P as default};
